import React from "react";
import { Link, Route, Routes } from "react-router-dom";

export const Registration_BusinessPage = () => {

    return <React.Fragment>

        
        <Route
        path='/business'
        element= {
            <React.Fragment>
                <div>Business</div>

            </React.Fragment>
        }
        />
        
        


    </React.Fragment>

}

export default Registration_BusinessPage
